DROP TABLE IF EXISTS `customcurrency`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `customcurrency` (
  `idCurrency` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary key',
  `username` varchar(255) NOT NULL COMMENT 'Owner of the custom currency',
  `name` varchar(45) NOT NULL COMMENT 'Name of the currency',
  `minEvents` decimal(6,2) unsigned NOT NULL COMMENT 'Number of events that must be counted',
  `limitType` int(10) unsigned DEFAULT '0' COMMENT '0 = minimum events must be met, 1 = no more than maximum',
  `timespan` int(10) unsigned NOT NULL COMMENT 'Timespan in which events must be found',
  `timespanType` int(10) unsigned NOT NULL COMMENT '0 = days, 1 = months',
  `eventType` int(10) unsigned NOT NULL COMMENT 'Type of event to count.',
  `categoryRestriction` varchar(25) NOT NULL DEFAULT '""' COMMENT 'The category (e.g., "Airplane") to which this applies.',
  `catClassRestriction` int(10) unsigned NOT NULL COMMENT 'If non-zero, only the catclass matters',
  `airportRestriction` varchar(45) NOT NULL COMMENT 'Airport that must be contained in the flight',
  `textRestriction` varchar(255) NOT NULL COMMENT 'Text that must be in the comments field or text property',
  PRIMARY KEY (`idCurrency`),
  KEY `Username` (`username`),
  CONSTRAINT `fkcustomcurrencyuser` FOREIGN KEY (`username`) REFERENCES `users` (`Username`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3058 DEFAULT CHARSET=utf8 COMMENT='Custom currencies for a user';
