perature',NULL),(30,'SPEED','Ground Speed',1,NULL,'Ground speed','Generally assumed to be in kts'),(31,'HERROR','Estimated Horizontal Position Error',1,NULL,'Estimated Horizontal Position Error','Generally in meters'),(32,'AIRSPEED','Airspeed',1,NULL,'Airspeed','Generally assumed to be in kts'),(33,'ALT','Altitude',0,'ALT','Altitude for the data point','Generally assumed to be in ft.  Must be > -200'),(34,'POSITION','Lat/Long Position in degrees/minutes',6,NULL,'A combined latitude/longitude','Must be in the form N dd mm.mmmmm W dd mm.mmmmm (or \"S\" or \"E\" as needed in place of \"N\" and \"W\").  dd = degrees, mm.mmmm= minutes.'),(35,'SAMPLE','Position #',0,NULL,'The ordinal number of the position report',NULL),(36,'ComputedSpeed','Speed (derived)',1,NULL,'Speed as computed from time-stamped position samples','Unit is knots.  Since this is computed, don\'t provide it'),(37,'TIMESTAMP','Time Stamp',7,'DATE','Synonym for DATE',NULL),(38,'Latitude','Latitude',4,'LAT','Synonym for LAT',NULL),(39,'Longitude','Longitude',4,'LON','Synonym for LON',NULL),(40,'Altitude','Altitude',0,'ALT','Synonym for ALT',NULL),(41,'Horizontal Error','Horizontal Error',0,'HERROR','Synonym for HERROR',''),(42,'Vertical Error','Vertical Error',0,'VERROR','Synonym for VERROR',NULL),(43,'VERROR','Estimated Vertical Position Error',1,NULL,'Estimated Vertical Position Error','Generally assumed to be in meters'),(44,'TZOffset','Timezone Offset',8,NULL,'Offset from UTC, in minutes','Number of minutes to ADD to a local time to get UTC time.  E.g., positive for west of GMT, negative for east.'),(45,'Course','Course',1,'Course','Course, expressed in degrees','Can be either magnetic or true'),(46,'Heading','Heading',1,'Heading','Heading, expressed in degrees','Can be either magnetic or true'),(47,'Local Date','Local Date',9,'NakedDate','Date with no time specified','Assumes 00:00 (midnight), if no Local Time is found'),(48,'Local Time','Local Time',10,'NakedTime','Time, with no date specified','Assu